package fuse

import (
	synv1 "github.com/integr8ly/managed-service-broker/pkg/apis/syndesis/v1beta1"
	brokerapi "github.com/integr8ly/managed-service-broker/pkg/broker"
	authv1 "github.com/openshift/api/authorization/v1"
	corev1 "k8s.io/api/core/v1"
	metav1 "k8s.io/apimachinery/pkg/apis/meta/v1"
)

const (
	FUSE_IMAGE_STREAMS_NAMESPACE string = "openshift"
)

// Fuse plan
func getCatalogServicesObj() []*brokerapi.Service {
	return []*brokerapi.Service{
		{
			Name:        "fuse",
			ID:          "fuse-service-id",
			Description: "fuse",
			Metadata: map[string]string{
				"serviceName": "fuse",
				"serviceType": "fuse",
				"imageUrl":    "data:image/png;base64,",
			},
			Plans: []brokerapi.ServicePlan{
				{
					Name:        "default-fuse",
					ID:          "default-fuse",
					Description: "default fuse plan",
					Free:        true,
					Schemas: &brokerapi.Schemas{
						ServiceBinding: &brokerapi.ServiceBindingSchema{
							Create: &brokerapi.RequestResponseSchema{},
						},
						ServiceInstance: &brokerapi.ServiceInstanceSchema{
							Create: &brokerapi.InputParametersSchema{
								Parameters: map[string]interface{}{
									"$schema": "http://json-schema.org/draft-04/schema#",
									"type":    "object",
									"properties": map[string]interface{}{
										"limit": map[string]interface{}{
											"description": "Fuse integrations limit",
											"type":        "number",
										},
									},
								},
							},
						},
					},
				},
			},
		},
	}
}

func getNamespaceObj(id, mk string) *corev1.Namespace {
	return &corev1.Namespace{
		ObjectMeta: metav1.ObjectMeta{
			Name: id,
			Labels: map[string]string{
				"monitoring-key": mk,
			},
		},
	}
}

func getUserViewRoleBindingObj(namespace, username string) *authv1.RoleBinding {
	return &authv1.RoleBinding{
		ObjectMeta: metav1.ObjectMeta{
			GenerateName: "syndesis-operator:view-",
			Namespace:    namespace,
			Labels: map[string]string{
				"app":                   "syndesis",
				"syndesis.io/app":       "syndesis",
				"syndesis.io/type":      "operator",
				"syndesis.io/component": "syndesis-operator",
			},
		},
		RoleRef: corev1.ObjectReference{
			Name: "view",
		},
		Subjects: []corev1.ObjectReference{
			{
				Kind: "User",
				Name: username,
			},
		},
	}
}

// Fuse Custom Resource
func getFuseObj(deployNamespace, consumerNamespace string, integrationsLimit int) *synv1.Syndesis {
	return &synv1.Syndesis{
		TypeMeta: metav1.TypeMeta{
			Kind:       synv1.SchemaGroupVersionKind.Kind,
			APIVersion: synv1.SchemeGroupVersion.Group + "/" + synv1.SchemeGroupVersion.Version,
		},
		ObjectMeta: metav1.ObjectMeta{
			Namespace:    deployNamespace,
			GenerateName: "fuse-",
			Annotations:  map[string]string{},
		},
		Spec: synv1.SyndesisSpec{
			Components: synv1.ComponentsSpec{
				Server: synv1.ServerConfiguration{
					Features: synv1.ServerFeatures{
						IntegrationLimit: integrationsLimit,
					},
				},
				Meta: synv1.MetaConfiguration{},
				Oauth: synv1.OauthConfiguration{
					SarNamespace: consumerNamespace,
				},
			},
		},
	}
}
